class Student:
    """
    Store and display student details.

    Attributes:
        name (str)
        roll_number (int)
        marks (list[int])

    Methods:
        average() -> float  # 0.0 if no marks
        grade() -> str      # 'A' if avg>=75, 'B' if >=60, else 'C'
        info() -> str       # "Alice (Roll: 101) | Avg: 80.0 | Grade: A"
    """

    def __init__(self, name, roll_number, marks):
        self.name = name
        self.roll_number = roll_number
        self.marks = marks

    def average(self):
        if not self.marks:
            return 0.0
        return sum(self.marks) / len(self.marks)

    def grade(self):
        avg = self.average()
        if avg >= 75:
            return 'A'
        elif avg >= 60:
            return 'B'
        else:
            return 'C'

    def info(self):
        avg = self.average()
        grade = self.grade()
        return f"{self.name} (Roll: {self.roll_number}) | Avg: {avg:.1f} | Grade: {grade}"

