        self.name=name
        self.rnumber=rnumber
        self.marks=marks
    def average(self):
        if len(self.marks)==0:
            return float(0)
        else:
            return sum(self.marks)/len(self.marks)
    def grade(self):
        if self.average()>=75:
            return "A"
        elif self.average()>=60:
            return "B"
        else:
            return "C"
    def info(self):
        return f"{self.name} (Roll: {self.rnumber}) | Avg: {self.average():.1f} | Grade: {self.grade()}"    





