class Student:
    """
    Store and display student details.
    Attributes:
    name (str), roll_number (int), marks (list[int])
    Methods:
    average() -> float # 0.0 if no marks
    grade() -> str # ’A’ if avg>=75, ’B’ if >=60,
    else ’C’
    info() -> str # "Alice (Roll: 101) | Avg:
    80.0 | Grade: A"
    """
    def __init__(self, name, roll_number, marks=[]):
        self.name = name
        self.roll_number = roll_number
        self.marks = marks

    def average(self):
        sum = 0
        for i in self.marks:
            sum += i
        return sum/(len(self.marks))

    def grade(self):
        avg = self.average()
        if avg >= 75:
            grade = 'A'
        elif avg >= 60:
            grade = 'B'
        else:
            grade = 'C'
        return grade

    def info(self):
        return f"{self.name.capitalize()} (Roll: {self.roll_number}) | Avg: {self.average()} | Grade: {self.grade()}"

