class Student:

    def __init__(self, name, roll_number, marks):
        self.name = name
        self.roll_number = roll_number
        self.marks = marks

    def average(self):
        if len(self.marks) == 0:
            return 0.0
        total = 0
        for i in self.marks:
            total+=i
        avg = total / len(self.marks)
        return avg

    def grade(self):
        avg = self.average()
        if avg >= 75:
            return 'A'
        elif avg >= 60:
            return 'B'
        else:
            return 'C'

    def info(self):
        return f"{self.name} (Roll: {self.roll_number}) | Avg: {self.average} | Grade: {self.grade}"

class Student:
    """
    Store and display student details.
    Attributes:
    name (str), roll_number (int), marks (list[int])
    Methods:
    average() -> float # 0.0 if no marks
    grade() -> str # ’A’ if avg>=75, ’B’ if >=60,
    else ’C’
    info() -> str # "Alice (Roll: 101) | Avg:
    80.0 | Grade: A"
    """

    def __init__(self, name, roll_number, marks):
        self.name = name
        self.roll_number = roll_number
        self.marks = marks

    def average(self):
        if len(self.marks) != 0:
            sum = 0
            for mark in self.marks:
                sum += mark
            avg = sum/len(self.marks)

            return avg

        else:
            return 0.0

    def grade(self):
        avg = self.average()
        if avg >= 75:
            return "A"
        elif avg >= 60:
            return "B"
        else:
            return "C"

    def info(self):
        details = f"{self.name} (Roll: {self.roll_number}) | Avg: {self.average()} | Grade: {self.grade()}"
        return details

