    average() -> float # 0.0 if no marks
    grade() -> str # 'A' if avg>=75, 'B' if >=60,
    else 'C'
    info() -> str # "Alice (Roll: 101) | Avg:
    80.0 | Grade: A"
    """
    def __init__(self, name, roll_number, marks=None):
        self.name = name
        self.roll_number = roll_number
        if marks!=None:
            self.marks = marks
    def average(self):
        sum=0
        for i in self.marks:
            sum+=i
        if len(self.marks)==0:
            return 0.0
        else:
            return float(sum/len(self.marks))
    def grade(self):
        avg=self.average()
        if avg>=75:
            return 'A'
        elif avg>=60 and avg<75:
            return 'B'
        else:
            return 'C'
    def info(self):
        return f"{self.name} (Roll: {self.roll_number}) | Avg: {self.average()} | Grade: {self.grade()}"

