class Student:
    """
    Store and display student details.
    Attributes:
        name(str), roll_number(int), marks(list[int])
    Methods:
        average() -> float      #0.0 if no marks
        grade() -> str          #'A' if avg>=75, 'B' if >=60,
                                         else'C'
        info() -> str           #"Alice (Roll:101)|Avg:80.0|Grade:A"
    """
    def __init__(self, name, roll_number, marks):
        self.name = name
        self.roll_number = roll_number
        self.marks = marks
    def average(self):
        if len(self.marks)==0:
            return 0.0
        else:
            avrg = sum(self.marks)/len(self.marks)
            return avrg
    def grade(self):
        if self.average()>=75:
            return "A"
        elif self.average()>=60:
            return "B"
        else:
            return "C"
    def info(self):
        details = self.name + " (Roll: " +str(self.roll_number)+")" + ' | ' + "Avg: " + str(self.average()) + ' | ' + "Grade: " + self.grade()
        return details

